import React from 'react';
import './App.css';
import LeftRectangle from './LeftRect.js';
import Rectangle from './RightRect.js';

function App() {
  return (
    <div>
      <div className="left" >
        <LeftRectangle />
      </div>
      <div className="right" >
        <RightRectangle />
      </div>
    </div>
  );
}

export default App;
